import './Content.css';
import calculator from './calculator.png';

export default function Content() {
    return (
        <div className="content">
            <div className="header">
                <h1>Cost of Living Calculator</h1>
                <img className="calculator" src={calculator} alt='calculator'></img>
            </div>
            <h2>Welcome to Salary Comp</h2><h4>Compare the real value of job offers by factoring in the Cost of Living.</h4>
            <p>Input the city and salary for each job offer you're considering, and we'll calculate the real value of each offer based on the cost of living in each location. You'll get a clear picture of how much you'll actually be able to afford in each city, and which job offer will give you more purchasing power and a better quality of life. 
            </p> 
        </div>
    )
}
